Description:
The contract is for the provision of the 4th generation of the Prisoner Escort & Custody Services contracts (PECS) in England and Wales. The Supplier will be responsible for the movement of adult males and females from prisons and police stations to courts as well as inter-prison transfers, the movement of children and young people from Young Offender Institutions (YOIs), Secure Training Centers (STCs) and Secure Children's Homes (SCHs) as well as care and security whilst in the court custody area and in the dock.

PECS4 contractors will continue to physically transport prisoners between locations but increasingly the requirement will be to enable and support changes to the core operating model for courts, prisons and the police resulting from the implementation of MoJ reform programmes, including an increased proportion of business being delivered in a virtual environment with greater emphasis on the use of video technology. 

The services will include:
- Escorting of adults and children and young people;
- At Court Care and Security;
- Inter Prison Transfers
- Bedwatches for Children and Young People
- Prisoner Welfare;
- Tornado and Mutual Aid;
- Incident Management;
- Audit and Quality Assurance

