The CSS Boats team is responsible for maintaining worldwide delivery of safe, capable and available craft to a diverse user community (Royal Navy, Royal Marines, Army, MOD Police, MOD A Block, Permanent Joint Operating Bases (PJOB), Royal Fleet Auxiliary (RFA), Cadets) thus enabling them to carry out their endorsed tasking in roles relating to maritime operations, responsive force, adaptive force, extended readiness and training, as well as Adventurous Training and Cadet Forces. The CSS Boats portfolio consists of circa 2,200 craft across 115 classes.

      This contract is to provide in-service support to the boat platforms that make up that fleet, thus providing capability to the user community. This contract is an enabling arrangement and all work will be tasked on a task-by-task basis, however can broadly be expected to include:

      i.	Refurbishment/Refit of in-service boats;
      ii.	Defect and damage repairs of in-service boats and their associated Versadock systems;
      iii.	Post Design Services (PDS) for in-service boats;
      iv.	All Maintenance of MoD Police boats;
      v.	Routine Maintenance of all boats that do not have access to any MOD-provided maintenance facilities or capabilities;
      vi.	The provision to purchase 2nd hand boats;
      vii.	Certifying authority surveys and certification and Naval Authority certification compliance;
      viii.	Safety Compliance, including undertaking the development of Safety and Environmental cases and delivery of associated Safety and Environmental Reports;
      ix.	Configuration control documentation and updates;
      x.	Trailers support;
      xi.	Inventory spares support;
      xii.	Reactive engineering covering obsolete and obsolescence issues;
      xiii.	Delegated Design Authority duties.

The scope of this Lot 4 Records Information Management Services is for the provision of a Records Information Management Service through the following six (6) service lines:

- Off-Site Records Information Management Service (full end to end service);
- Off-Site Storage of Inactive Records;
- Off-Site and/or On-Site Secure Shredding, Destruction and Disposal Services;
- Off-Site and/or On-Site Specialist Records Management Services;
- Off-Site and/or On-Site combined Records Information Management Services;
- Off-Site and/or On-Site Scanning Services.
The Supplier shall support the Authority through this Framework Agreement by promoting a fully electronic Records Information Management System to Contracting Authorities that shall allow:
- efficient management of Physical and Digital Information, in line with the Government's digital by default agenda;
- Contracting Authorities to meet ongoing physical storage demands;
- the separation of 'Active' and 'Inactive' Records to improve the management of inactive Records resulting in more competitive storage costs;
- scanning services to be provided in line with the Government's digital by default agenda;
- combined On-Site and Off-Site Records Information Management Services to be provided where a planned move to a fully Off-Site Records Information Management Service is a defined strategic objective;
- shredding, destruction and disposal of Records in line with the Government's environmental and waste policies; and
- compliance with The National Archives Gateway process, where required.
The Lot 4 Framework Agreement will expire on 26.10.2020 with a maximum Call Off period of seven (7) years(84) months.

