The intention is to use the KIHCP approach for the integration of a range of systems, interventions and services in order to improve outcomes for children, young people, their families and communities, with a focus on mental and emotional health and wellbeing.

Our vision: 
Kirklees is a great place to grow up where every child and young person: 
- is safe and loved, healthy and happy and free from harm;
- and has the chance to make the most of their talents, skills and qualities to fulfil their potential. 

What do we want to achieve

We want to bring together organisations, people and services to develop a shared approach so that: 

- every child has the best start in life; 
- all children, young people and adults maximise their capabilities and have control over their lives. 

The plan covers the whole spectrum of services for children and young people's mental health and wellbeing from health improvement and prevention work, to support and interventions for children and young people who have existing or emerging mental health problems, as well as transitions between services.

To design and deliver more integrated child and family health services in Kirklees using the framework of the HCP to improve the outcomes for children, young people and their families.  The services that are currently delivering elements of the HCP and CAMHS include: 

- Health visiting and family nurse partnership (0-5 year old public health resource); 
- School nursing (5-19 year old public health resource); 
- Children and adolescent mental health service ("CAMHS") tiers 2 and 3; 
- Learning from the pilot Single Point of Access in the CAMHS Transformation Plan; 
- Children's weight management service; 
Healthy vitamin scheme. 

Commissioners hope that any potential model will be innovative and demonstrate a robust, fully integrated delivery partnership approach. They are intending to encourage collaboration wherever possible.

